	int[,] copy=new int[width,height];

	float time=0;

	// Use this for initialization
	void Start () {
		for (int i = 0; i < width; i++) {
			for (int j = 0; j < height; j++) {
				Instantiate (light, new Vector3(i,j,0),new Quaternion(0,0,0,0)).name="light-"+i+"-"+j;
			}
		}
	}
	
	// Update is called once per frame
	void Update () {
		if ((time += Time.deltaTime) >= 1) change ();
	}

	void change(){
		Debug.Log (time);
		time = 0;

		for(int i=0;i<width;i++){  //惑星のループ
			for(int j=0;j<height;j++){
				int count=0;
				for(int x=-1;x<=1;x++){  //衛星のループ
					for(int y=-1;y<=1;y++){
						if(x!=0 || y!=0){
							if(i+x>=0 && i+x<=width-1 && j+y>=0 && j+y<=height-1 ){
								if(field[i+x,j+y]>=1){
									count+=1;
								}
							}
						}
					}
				}
				copy[i,j]=next_state(field[i,j],count);
			}
		}
		for(int i=0;i<width;i++){
			for(int j=0;j<height;j++){
				GameObject.Find ("light-" + i + "-" + j).GetComponent<Renderer> ().material.color = new Color (0, field[i,j]*255, 0);
				field[i,j]=copy[i,j];
			}
		}
	}

	int next_state(int me, int other){
		if(other==3) return 1;
		else if(other==2) return me;
		else return 0;
	}
}
